import React from "react";
import { Component } from "react";

class Itinararies extends Component {
  constructor(props) {
    super(props)
    this.state = {"itineraries": [] }
 }

  render() {
    return (
      this.state.itinararies.map()((i)=><div>{i}</div>)
    )
  }

  componentDidMount() {
    fetch( "http://localhost:5000/api/tinerary/search?city={props.city}")
      .then(response =>response.json())
      .then(data => {this.setState({"itinararis": data}); console.log(data)});
}

} /* end class itinararies */

export default Itinararies;
